import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const ListServTrans = () => {
  const [records, setRecords] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [filterStatus, setFilterStatus] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/list_servtrans")
      .then((res) => res.json())
      .then((data) => {
        if (data.success) {
          setRecords(data.data);
          setFiltered(data.data);
        } else alert("Error fetching data");
      })
      .catch((err) => console.error("Error:", err));
  }, []);

  const handleFilter = (status) => {
    setFilterStatus(status);
    if (!status) setFiltered(records);
    else setFiltered(records.filter((r) => r.StatusOfServiceRequest === status));
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h2 style={{ textAlign: "center", background: "#2f3640", color: "white", padding: "15px" }}>
        Service Transactions List
      </h2>

      <div style={{ textAlign: "center", margin: "10px" }}>
        <label>Filter by Status: </label>
        <select
          value={filterStatus}
          onChange={(e) => handleFilter(e.target.value)}
          style={{ marginLeft: "10px", padding: "5px" }}
        >
          <option value="">All</option>
          <option value="OP">Open</option>
          <option value="IP">In Progress</option>
          <option value="CL">Closed</option>
        </select>
      </div>

      <table border="1" width="100%" cellPadding="8" style={{ borderCollapse: "collapse" }}>
        <thead style={{ backgroundColor: "#dcdde1" }}>
          <tr>
            <th>ID</th>
            <th>Property</th>
            <th>Tenant</th>
            <th>Type</th>
            <th>Description</th>
            <th>Login Date</th>
            <th>Est. Cost</th>
            <th>Act. Cost</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {filtered.map((r) => (
            <tr key={r.SequenceNo}>
              <td>{r.SequenceNo}</td>
              <td>{r.building_name || r.PropertyCode}</td>
              <td>{r.TenantName || "-"}</td>
              <td>{r.ServiceRequestType}</td>
              <td>{r.ServiceRequestDescription}</td>
              <td>{r.ServiceRequestLoginDate}</td>
              <td>{r.ServiceRequestEstimatedCost}</td>
              <td>{r.ServiceRequestActualCost}</td>
              <td>{r.StatusOfServiceRequest}</td>
              <td>
                <Link
                  to={`/edit-servtrans/${r.SequenceNo}`}
                  style={{
                    backgroundColor: "#27ae60",
                    color: "white",
                    padding: "5px 10px",
                    borderRadius: "5px",
                    textDecoration: "none",
                  }}
                >
                  Edit
                </Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ListServTrans;
